import QuantumElement from '../core/quantumElement';
import { h } from '../core/quantumCore';

const fonAwesomeData = "data:text/css;base64,";

/*ICON
<link rel="stylesheet" href="./static/font-awesome.css"></link>
atributes: icon: string
*/
export default class qIcon extends QuantumElement {
    public static tagName = 'q-icon';
    template() {
        let spn = (this.hasAttribute('spin'))?' fa-spin':'';
        return  <div>
                    <link rel="stylesheet" type="text/css" href={fonAwesomeData}/>
                    <i className={`fa fa-${this.attrs.icon}${spn} large`}></i>
                </div>;
    }

    static get observedAttributes() {
        return ['icon', 'spin'];
    }

    styles() { return `
        :host {
            height: 32px;
            width: 32px;
            display: inline-flex;
            align-items: center;
            justify-content: center;
            align-self: center;
            color: rgb(var(--q-material-primary-rgb));
        }
        .xsmall {
            font-size: 70%;
        }
        .small {
            font-size: 85%;
        }
        
        .large {
            font-size: 140%;
        }
        
        .xlarge {
            font-size: 170%;
        }
    `; }

    constructor() {
        super(false);
    }
}